import { Typography, Box } from '@mui/material';
import React from 'react';
import { StudentsItem, StudentsItemProps } from './StudentItem';

const studentDataMock: StudentsItemProps[] = [
    { student: 'Nir', cardId: '1234'},
    { student: 'Shiri', cardId: '2323'},
    { student: 'Tohar', cardId: '1000'},
    ]
export const StudentsPage = () => {

    return (
    <Box>
         <Typography> Students </Typography>
        { studentDataMock.map( studentItem => <StudentsItem key={studentItem.cardId} student={studentItem.student} cardId={studentItem.cardId}  />)}
    </Box>);
}
